import React, { useEffect, useState } from "react";

function ProjectCard(props) {
  const [skills, setSkills] = useState([]);
  useEffect(() => {
    setSkills(props.skills);
  }, [props.skills]);
  console.log(skills);
  const [toggleSkill, setToggleSkills] = useState(false);
  const handleMoreSkills = () => {
    setToggleSkills(!toggleSkill);
  };

  return (
    <div id={props.key} className="xl:w-1/4 md:w-1/2 p-4">
      <div
        className={`bg-gray-100 p-4 rounded-lg  overflow-hidden ${
          toggleSkill ? "h-fit" : "h-[28.5rem]"
        }`}
      >
        <img
          className="h-40 rounded w-full object-cover object-center "
          src={props.image ? props.image : "https://dummyimage.com/723x403"}
          alt="content"
        />
        <div className="flex w-full justify-between items-center">
          <h3 className="tracking-widest text-yellow-500 text-xs ml-1  font-medium title-font mt-5">
            {props.language ? props.language : ""}
          </h3>
          <div className="h-6 mt-4    flex gap-4">
            <a
            
              href={props.live_link}
              alt="alt text"
              target="_blank"
              rel="noopener noreferrer"
              className={`${props.live_link===""?"hidden":""}  hover:transition-all hover:ease-in hover:delay-100   hover:scale-125`}
            >
              <img
                src="data:image/png;base64,"
                alt=""
                className="h-full w-full object-cover"
                srcset=""
              />
            </a>
            <a
              href={props.git_link}
              alt="alt text"
              target="_blank"
              rel="noopener noreferrer"
              className="   hover:transition-all hover:ease-in hover:delay-100   hover:scale-125  "
            >
              <img
                src="data:image/png;base64,"
                alt=""
                className="h-full w-full object-cover"
                srcset=""
              />
            </a>
          </div>
        </div>
        <h2 className="h-14 text-lg pt-1  font-extrabold ml-1 text-gray-700 text-center   mb-1">
          {props.title}
        </h2>
        <p className="leading-relaxed text-base text-ellipsis ml-1 line-clamp-4 text-left">
          {props.overview}
        </p>
        <div
          className={`mt-5 py-1 flex flex-wrap justify-center gap-y-5 gap-x-2 overflow-hidden ${
            toggleSkill ? "h-fit" : "h-8"
          }`}
        >
          {skills.map((skill, index) => (
            <div
              key={index}
              className="hover:scale-105 flex justify-center items-center h-fit w-fit  bg-slate-800 text-gray-100 py-1 px-4 text-nowrap  rounded-full text-xs font-serif "
            >
              {skill}
            </div>
          ))}
        </div>
        <div className="flex justify-center w-full pt-1">
          <button className=" text-sm  hover:border-2 py-1 hover:rounded-2xl hover:shadow-md hover:shadow-black hover:bg-gray-300  px-2" onClick={handleMoreSkills}>
            {toggleSkill ? "see less skills ..." : "see more skills ..."}
          </button>
        </div>
      </div>
    </div>
  );
}

export default ProjectCard;
